import * as React from 'react';
import { View, StyleSheet ,Text} from 'react-native';
import { Video } from 'expo-av';

const Home = ({ navigation }) => {
  const video = React.useRef(null);
  const [status, setStatus] = React.useState({});

  return (
    <View style={styles.container}>
      <Text>Data</Text>
      <Video
        ref={video}
        source={{
          uri: 'https://vod-progressive.akamaized.net/exp=1641815038~acl=%2Fvimeo-prod-skyfire-std-us%2F01%2F2398%2F22%2F561990865%2F2657615979.mp4~hmac=f6d31747cd74600cf3111b515ff1da973eb0ef827105c9ef3ad635afe1e48814/vimeo-prod-skyfire-std-us/01/2398/22/561990865/2657615979.mp4?filename=Trash+-+77247.mp4',
        }}
        style={styles.backgroundVideo}
        rate={1}
        shouldPlay={true}
        isLooping={true}
        volume={1}
        isMuted={true}
        resizeMode="cover"
      />
      <View style={styles.buttons}>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    backgroundColor: '#ecf0f1',
  },
  backgroundVideo: {
    flex: 1,
    top: 0,
    left: 0,
    bottom: 0,
    right: 0,
  },
});

export default Home;
